1:42 PM Defendant Tyler R. Staab appeared by video, in custody. Attorney Gail Prost appeared by video for State of Wisconsin. Attorney Nathan J. Heim appeared by video for Tyler R. Staab. Rights explained. Count 1, Burglary of a Building as a Repeater, Guilty plea entered. Convicted. The remaining counts are dismissed and read in. State is in compliance with victim's rights. Parties comment. 
The defendant is sentenced to eight (8) years in the Wisconsin State Prison System. Three (3) years initial confinement followed by five (5) years extended supervision concurrent with any other sentence he is currently serving.
The conditions of extended supervision:
1)	Assessment, treatment, counseling as deemed appropriate by the Department's assessment process;
2)	Maintain fulltime employment, schooling, job search or combination; 
3)	Pay court costs;
4)	Pay supervision fees;
5)	Submit to a DNA sample;
6)	No contact with 10602 Ravine Drive, Two Rivers, WI or any buildings on that property.
The Court finds the defendant has two (2) days sentence credit. 
The defendant is eligible for both the Challenge Incarceration Program and the Drug Abuse Program.
Minutes.
